import React, { useState, useEffect } from 'react';
import PropTypes from 'prop-types';
// classNames aplica una clase u otra dependiendo de el valor de done
import classNames from 'classnames';

const WishItem = ({done, text, id, onDoneChange,}) => {
    const [age, setAge] = useState(0); // age cuenta en segundos el tiempo de vida del componente
    // useEffect es un hook usado para sincronizar el componente con un sistema externo
    // en este caso con la variable done del array de deseos
    useEffect(() => {
        let ageInterval;
        if (done) {
            setAge(0);
        } else {
            ageInterval = setInterval(() => {
                if (done) {
                    clearInterval(ageInterval);
                } else {
                    setAge(a => a + 1);
                }
            }, 1000);
        }
        return () => clearInterval(ageInterval);
    }, [done]);
    // se define la clase de li dependiendo de age
    return (
        <li
            className={classNames('wish-list__item', {
                'wish-list__item--done': done,
                'wish-list__item--warning': age >= 5 && age < 10,
                'wish-list__item--danger': age >= 10,
            })}
        >
            <input
                id={id}
                type="checkbox"
                checked={done}
                onChange={e => onDoneChange(e.target.checked)}
            />
            <label htmlFor={id}>{text}</label>
        </li>
    );
};

WishItem.propTypes = {
    done: PropTypes.bool,
    text: PropTypes.string,
    id: PropTypes.string,
    onDoneChange: PropTypes.func,
};

WishItem.defaultProps = {
    done: false,
    text: '',
    id: '',
    onDoneChange: () => { },
};

export default WishItem;
